Sometimes when creating a custom markdown tile you need to consider what to display when there are no results returned from a query. Empty or blank visualizations can be a bit confusing to end-viewers. For example, here’s a markdown tile displaying new customer names,
simple-dash-example1176×886 85.1 KB
The code here is pretty straight forward and works well when results are returned:
<style>
  h2 { margin-top: 0; }
  ul.name-list {
    column-count: auto;
    column-width: 8rem;
  }
</style>
## Welcome to all of our customers {{#filters.users.state.value}}from {{filters.users.state.value}}{{/filters.users.state.value}} that joined yesterday!

<ul class="name-list">
{{#result}}
 <li>{{users.full_name.value}}</li>
{{/result}}
</ul>

However, when I filter by a state that didn’t have any new customers, no results returned and the blank tile looks like something might be broken. It would be nicer to put up a message that says we don’t have any new customers in this situation:

One useful pattern I’ve found to accomplish this is to use mustache’s inverted sections. Regular sections are used in mustache to display content when there are one or more items. Inverted sections do the opposite, rendering content when a the content referenced is empty, false or non-existent.
The syntax is pretty straight forward: use the caret (^) to indicate the beginning of an inverted section (like {{^result}})and then a forward slash (/) to indicate the end (like {{/result}}. Inside the inverted section you put the content you want to display when there are no results.
So let’s go clean up the example above! After the <ul> listing all the names when they exist, ee can add the inverted section:
{{^result}}
  <p>No new customers</p>
{{/result}}

I can also get a bit fancy and insert the filter value when it exists. Here’s what the end result looks like and the full markdown code:

<style>
  h2 { margin-top: 0; }
  ul.name-list {
    column-count: auto;
    column-width: 8rem;
  }
</style>
## Welcome to all of our customers {{#filters.users.state.value}}from {{filters.users.state.value}}{{/filters.users.state.value}} that joined yesterday!

<ul class="name-list">
{{#result}}
 <li>{{users.full_name.value}}</li>
{{/result}}
</ul>
{{^result}}
  <p>No new customers from {{filters.users.state.value}} {{^filters.users.state.value}} anywhere {{/filters.users.state.value}}</p>
{{/result}}

Hopefully this example gives you a few ideas for smoothing out your markdown experiences and ideas to test out inverted sections. Have fun and share any cool tricks you come up with!

I have been playing around with the idea of tabbed dashboards, inspired by some of the work that Jade and Russ have been doing. Once I realized that the tabbed dashes were just markdown tiles with CSS and HTML it opened up a lot of different ideas for me.
The first thing that came to mind was adding drop downs to the tabs, making it a true, dynamic nav bar, that would allow users to create more levels of organization between related dashboards. Breaking up certain topics, grouping together whatever you like, in a way that is pretty intuitive to the user.
Here is a video of what an example looks like, and a bit of a dive into the code:

It was also pretty straightforward to add some cool CSS properties to make things actionable on hover(i.e. changing color of properties). There is a lot more you can do too!
But I am going to go through the different properties, so that anyone who wants to apply a tabbed dash can easily do so🤓
There are basically 3 main parts:

HTML drop down structure
CSS custom styling
Correctly linking href references

1.HTML STUCTURE

tab-container holds all of the tabs in one place
each tab represents a clickable item, and some have a dropdown-menu which will expand on hover
the dropdown options are contained in an unordered list (<ul>). And within that unordered list are list items (<li>), which represent each of the options in the dropdown
the list items each have an anchor tag in them <a>. An anchor tag has an href="", inside the quotes is where you enter to URL of where you want to navigate to on click of the given dropdown option🚀
within the anchor tag, is where you type out what you want the user to see for the given drop down option: <a href="url_to_dashboard"> "dashboard_name"</a>

<div class="tab-container">
  <!-- Each tab, can contain dropdown menus -->

  <!-- Tab for Line Graphs with dropdown -->
  <div class="tab dropdown">
    <span>Line Graphs</span>
    <ul class="dropdown-menu">
      <li><a href="#">Line Shaded Under</a></li>
      <li><a href="#">Line Dashed Reference Line</a></li>
    </ul>
  </div>

  <!-- Tab for Bar Charts with dropdown -->
  <div class="tab dropdown">
    <span>Bar Charts</span>
    <ul class="dropdown-menu">
      <li><a href="#">Standard Bar</a></li>
      <li><a href="#">Side by Side Bar</a></li>
    </ul>
  </div>

  <!-- Tab for Column Charts with dropdown -->
  <div class="tab dropdown">
    <span>Column Charts</span>
    <ul class="dropdown-menu">
      <li><a href="#">Standard Column</a></li>
      <li><a href="#">Pretty Column</a></li>
    </ul>
  </div>

  <!-- Tab for Maps with dropdown -->
  <div class="tab dropdown">
    <span>Maps</span>
    <ul class="dropdown-menu">
      <li><a href="#">Point Map</a></li>
      <li><a href="#">Heat Map</a></li>
    </ul>
  </div>

  <!-- Tab for Pie Charts with dropdown -->
  <div class="tab dropdown">
    <span>Pie Charts</span>
    <ul class="dropdown-menu">
      <li><a href="#">Donut Pie</a></li>
    </ul>
  </div>

  <!-- Tab for Spreadsheet (no dropdown) -->
  <div class="tab">
    <span><a href="#">Spreadsheet</a></span>
  </div>
</div>


2.CSS STRUCTURE

.tab-container: This flex container holds all the tabs in a row.
.tab: The tab elements have basic padding, a border at the bottom, and a hover effect that changes their color and adds a border.
.dropdown-menu: Initially hidden, this dropdown becomes visible when hovering over its parent tab (.dropdown). It will stay hidden until hovered on by the mouse, then it will show the drop down list items
Hover effects: Both the tab and its dropdown items have hover states to change their appearance and make the interface interactive. If you go into the CSS below, it is commented to show the main functionalities of each of the classes
You then apply those classes to the html for the affects of the CSS to be seen

/* Container for all the tabs */
.tab-container {
  display: flex;
  justify-content: flex-start;
  width: 100%;
  border-bottom: 2px solid #ddd;
}

/* Styling for each tab */
.tab {
  background-color: transparent;
  padding: 10px 15px;
  cursor: pointer;
  font-size: 16px;
  font-weight: 500;
  border: none;
  border-bottom: 3px solid transparent;
  position: relative; /* To position dropdown */
  transition: all 0.3s ease;
}

/* Hover state for active tabs */
.tab:hover {
  color: #ED6C91;
  border-bottom: 3px solid #ED6C91;
}

/* Styling for dropdown menu (hidden by default) */
.dropdown-menu {
  display: none;
  position: absolute;
  top: 100%; /* Position below the tab */
  left: 0;
  background-color: white;
  border-radius: 8px;
  box-shadow: 0px 4px 8px rgba(0, 0, 0, 0.1);
  padding: 10px 0;
  list-style: none;
  transition: all 0.3s ease;
}

/* Show dropdown when hovering over the tab */
.dropdown:hover .dropdown-menu {
  display: block;
}

/* Styling for individual dropdown items */
.dropdown-menu li {
  padding: 10px 15px;
  transition: background 0.2s ease;
}

/* Links inside dropdown items */
.dropdown-menu li a {
  text-decoration: none;
  color: #333;
  font-size: 14px;
  display: block;
}

/* Hover effect for dropdown items */
.dropdown-menu li:hover {
  background-color: #ED6C91;
}

.dropdown-menu li:hover a {
  color: white;
}


3.Setting the URL

This isn’t too complex, you just want to grab the url of the dashboard you are navigating to, it will look something like this:

<li><a href="/dashboards/622c1346" class="tab-link">Heat Map</a></li>

You just want /dashboard/dashboard_hash. This will be the characters you see at the end of the URL when you are on a dashboard.
Overall Simplified Summary

HTML Structure:


Define a tab-container to hold the individual tab elements.
For tabs with dropdown options, nest a ul with li elements inside each tab.


CSS Styling:


Use display: flex for the container to align the tabs.
Apply styles to the tabs to make them clickable and have a hover effect.
For dropdowns, hide them by default and only display them when the user hovers over the tab (.dropdown:hover .dropdown-menu).

Feel free to use this as a base structure, it is DEFINITELY easier to start with some kind of template. Then go in change URLs, mess with the CSS, break things and see what awesome cool stuff we can build in markdowns🤩

Need to edit the min-max of your boxplot? Or make other code customizations that aren’t available in the default boxplot visualization?
You can use this vega-lite starting point of a boxplot to use within Omni’s vega editor. Note you must update the field parameters to reference the fields in your own query and the extent parameter could be modified from “min-max” to other values like 1.5, which is the standard box plot whisker length (1.5 times the interquartile range).
here's a starting point for building this in the vega editor:
{ 
  "mark": {
    "type": "boxplot",
    "extent": "min-max"
  },
  "encoding": {
    "x": {"field": "main__order_items\\.status", "type": "ordinal"},
    "color": {"field": "main__order_items\\.created_at_date\\[month\\]", "type": "nominal", "legend": null},
    "y": {
      "field": "main__order_items\\.sale_price_sum",
      "type": "quantitative",
      "scale": {"zero": false}
    }
  }
}

Any further customization options could be found in the vega-lite library or your favorite AI helper could give you a few pointers

